import { Link } from 'react-router-dom';

const Blog = () => {
    const [posts, setPosts] = useState([]);
    return(
        <>
            <div className="container">
                <div className="row">
                    <div className="col-sm-12">
                        <h1>Blog</h1>
                        {posts}
                    </div>
                </div>

            </div>

        </>
    )
}

export default Blog;
